  function isInPolygon(polygon, point): boolean {
    // A point is in a polygon if a line from the point to infinity
    // crosses the polygon an odd number of times
    let isInside = false;
    const polyLen = polygon.length;

    for (let i = 0, j = polyLen - 1; i < polyLen; j = i++) {
      const xi = polygon[i].x,
        yi = polygon[i].y;
      const xj = polygon[j].x,
        yj = polygon[j].y;

      const intersect =
        yi > point.y !== yj > point.y &&
        point.x < ((xj - xi) * (point.y - yi)) / (yj - yi) + xi;

      if (intersect) {
        isInside = !isInside;
      }
    }

    return isInside;
  }

