      const context = canvas.getContext("2d");
      const coordinates = getCoordinates(ev);
      setInitCoords(undefined);

      canvas.style.cursor = "point";
      if (!context || isDrawing || !coordinates || !zoneSelected) {
        return;
      }

      const activePoint = getClosestPoint(
        polygonToShow,
        coordinates,
        DIST_TO_POINT
      );

      const isInPoly = isInPolygon(polygonToShow, coordinates);
      if (ev.type === "mousedown") {
        if (isInPoly && !activePoint) {
          setInitCoords(coordinates);
          setIsPolygonDragging(true);
        }
      } else if (ev.type === "mousemove") {
        if (isInPoly && !activePoint && initCoords && isPolygonDragging) {
          setPolygonToShow((prev) =>
            prev.map((point) => ({
              ...point,
              x: point.x - (initCoords.x - coordinates.x),
              y: point.y - (initCoords.y - coordinates.y),
            }))
          );
        }
        setInitCoords(coordinates);
      } else if (ev.type === "mouseup") {
        setInitCoords(undefined);
        setIsPolygonDragging(false);
      }

      if (activePoint) {
        // –ï—Å–ª–∏ –º—ã –Ω–∞–≤–µ–ª–∏ –∫—É—Ä—Å–æ—Ä –Ω–∞ —Ç–æ—á–∫—É –≤—ã—Å—Ç–∞–≤–ª—è–µ–º –µ–µ –∞–∫—Ç–∏–≤–Ω–æ–π
        canvas.style.cursor = "move";
