        if (ev.type === "mousedown") {
          // –ø—Ä–∏ –Ω–∞–∂–∞—Ç–∏–∏ –º—ã—à–∏  –≤–∫–ª—é—á–∞–µ–º —Ä–µ–∂–∏–º –ø–µ—Ä–µ—Ç–∞—Å–∫–∏–≤–∞–Ω–∏—è
          // –∏ –Ω–∞—Ö–æ–¥–∏–º –∏–Ω–¥–µ–∫—Å –ø–µ—Ä–µ—Ç–∞—Å–∫–∏–≤–∞–µ–º–æ–π —Ç–æ—á–∫–∏
          setIsPointDragging(true);
          const pointIndex = polygonToShow.indexOf(activePoint);
          setDragPointIndex(pointIndex);
        }

        if (ev.type === "mouseup") {
          // –ø—Ä–∏ –æ—Ç–∂–∞—Ç–∏–∏ –º—ã—à–∏  –≤—ã–∫–ª—é—á–∞–µ–º —Ä–µ–∂–∏–º –ø–µ—Ä–µ—Ç–∞—Å–∫–∏–≤–∞–Ω–∏—è
          // –æ–±–Ω—É–ª—è–µ–º –∏–Ω–¥–µ–∫—Å –ø–µ—Ä–µ—Ç–∞—Å–∫–∏–≤–∞–µ–º–æ–π —Ç–æ—á–∫–∏
          // –≤—ã–∑—ã–≤–∞–µ–º —Ñ—É–Ω–∫—Ü–∏—é —Å–æ—Ö—Ä–∞–Ω–µ–Ω–∏—è –∑–æ–Ω—ã
          setIsPointDragging(false);
          setDragPointIndex(undefined);
          handleZoneChangeSave(
            zoneSelected,
            polygonToShow,
            zoneSelected.isFullFrame
          );
        }
      } else if (hoveredPoint) {
        // –µ—Å–ª–∏ –ø—Ä–æ—Å—Ç–æ –≤–æ–¥–∏–º –ø–æ –∫–∞–Ω–≤–∞—Å—É –∏ –±—ã–ª–∞–∞–∫—Ç–∏–≤–Ω–∞—è —Ç–æ—á–∫–∞
        // –æ–±–Ω—É–ª—è–µ–º –∞–∫—Ç–∏–≤–Ω—É—é —Ç–æ—á–∫—É –∏  –≤–∏–¥ –∫—É—Ä—Å–æ—Ä–∞
        canvas.style.cursor = "auto";
        setHoveredPoint(undefined);
      }

      // –ø–æ–∫–∞ –º—ã —Ç–∞—â–∏–º —Ç–æ—á–∫—É –ø–æ—Å—Ç–æ—è–Ω–Ω–æ  –º–µ–Ω—è–µ–º –µ–µ –∫–æ–æ—Ä–¥–∏–Ω–∞—Ç—ã –≤ –ø–æ–ª–∏–≥–æ–Ω–µ
      // —á—Ç–æ–±—ã –Ω–∞ –º–æ–º–µ–Ω—Ç –æ—Ç–∂–∞—Ç–∏—è –º—ã—à–∫–∏ –º—ã –º–æ–≥–ª–∏ —Å–æ—Ö—Ä–∞–Ω–∏—Ç—å –Ω–æ–≤—ã–µ –∫–æ–æ—Ä–¥–∏–Ω–∞—Ç—ã
      if (isPointDragging && dragPointIndex !== undefined) {
        setPolygonToShow((prev) =>
          prev.map((point, i) => (i === dragPointIndex ? coordinates : point))
        );
      }
    },
    [
      isDrawing,
      isPointDragging,
      dragPointIndex,
      polygonToShow,
      handleZoneChangeSave,
      zoneSelected,
      getCoordinates,
      hoveredPoint,
      initCoords,
      isPolygonDragging,
    ]
  );

#include <iostream>
#include <vector>
#include <fstream>


int main() {
    setlocale(LC_ALL, "ru");

    std::ifstream fin("input.txt");

    std::vector<int> greed(1001);
    
    int size, value, count = 0;

    fin >> size;

    for (int i = 0; i < size; i++) {
        fin >> value;
        greed[value]++;
    }

    fin >> size;

    for (int i = 0; i < size; i++) {
        fin >> value;
        if (greed[value]) {
            count++;
            greed[value]--;
        }
        else {
            for (int j = value - 1; j > 0; j--) {
                if (greed[j]) {
                    count++;
                    greed[j]--;
                    break;
                }
            }
        }
    }

    std::cout << count;
}

